Zweden
Actie / Misdaad
127 minuten

geregisseerd door Jens Jonsson
met Matias Varela, Joel Kinnaman en Malin Buska

Johan leeft nu in ballingschap en is meer dan ooit vastberaden om er achter te komen wat er met zijn vermiste zus Camilla gebeurd is. Elk spoor leidt hem naar de georganiseerde misdaad in Stockholm, waar Jorge op het punt staat om zijn laatste slag te slaan: het plegen van de grootste overval uit de Zweedse geschiedenis. Tijdens de complexe voorbereidingen ontmoet hij Nadja, een vrouw uit zijn verleden.


